import React, { Component } from 'react'
import PropTypes from 'prop-types';

export class Todositem extends Component {
  render() {
    return (
      <div>
        <p> { this.props.i.title } </p>
      </div>
    )
  }
}

//Props Types
Todositem.propTypes = {
    todo : PropTypes.object.isRequired
}
export default Todositem
